    private int checkAhead(char c) {
        int length = this.zzBuffer.length();

        for (int pos = this.zzMarkedPos; pos < length; pos++) {
            char charAhead = zzBuffer.charAt(pos);

            if (charAhead == c) {
                return pos;
            }

            if (charAhead != ' ' && charAhead != '\t' && charAhead != '\f') {
                return -1;
            }
        }

        return -1;
    }


